DROP TABLE IF EXISTS `ProductCategory`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
 SET character_set_client = utf8mb4 ;
CREATE TABLE `ProductCategory` (
  `ProductCategoryID` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Primary key for ProductCategory records.',
  `ParentProductCategoryID` int(11) DEFAULT NULL COMMENT 'Product category identification number of immediate ancestor category. Foreign key to ProductCategory.ProductCategoryID.',
  `Name` varchar(100) CHARACTER SET utf8mb4 NOT NULL COMMENT 'Category description.',
  `rowguid` char(36) CHARACTER SET ascii NOT NULL COMMENT 'ROWGUIDCOL number uniquely identifying the record. Used to support a merge replication sample.',
  `ModifiedDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Date and time the record was last updated.',
  PRIMARY KEY (`ProductCategoryID`),
  UNIQUE KEY `AK_ProductCategory_rowguid` (`rowguid`),
  UNIQUE KEY `AK_ProductCategory_Name` (`Name`),
  KEY `FK_ProductCategory_ProductCategory_ParentProductCategoryID_Pro4` (`ParentProductCategoryID`),
  CONSTRAINT `FK_ProductCategory_ProductCategory_ParentProductCategoryID_Pro4` FOREIGN KEY (`ParentProductCategoryID`) REFERENCES `ProductCategory` (`ProductCategoryID`) ON DELETE NO ACTION ON UPDATE NO ACTION
